+    .filter(
+      (href: string) =>
+        !href.includes("/@") &&
+        !href.includes("/post/") &&
+        !href.includes("threads.net")
+    );
+
+  const authorHandle = authorLink?.pathname?.startsWith("/@")
+    ? authorLink.pathname.substring(2)
+    : authorLink?.href?.match(/@(.+?)(?:$|\/)/)?.[1];
+
+  const authorName = authorLink?.textContent?.trim();
+
+  const authorUrl = authorLink
