+  for (const span of postsElements) {
+    const text = span.textContent?.trim() || "";
+    if (text.includes("posts") && text.match(/\d/)) {
+      const numericMatch = text.match(/([0-9,]+)/);
+      if (numericMatch) {
+        postsCount = numericMatch[1].replace(/,/g, "");
+        break;
+      }
+    }
